const ResultsTable = ({ results }) => {
  if (!results || results.length === 0) return null;

  return (
    <table
      style={{
        width: "100%",
    maxWidth: "1100px",
    margin: "20px auto",
    borderCollapse: "collapse",
    fontFamily: "Ramaraja, serif",
    backgroundColor: "white",
    boxShadow: "0 2px 6px rgba(0,0,0,0.05)",
      }}
    >
      <thead>
        <tr style={{ backgroundColor: "#FF671D", color: "white", fontSize: "16px" }}>
          <th style={{ padding: "12px" }}>University Name</th>
          <th style={{ padding: "12px" }}>Country</th>
        </tr>
      </thead>
      <tbody>
        {results.map((uni, idx) => (
          <tr
            key={idx}
            style={{
              borderBottom: "1px solid #eee",
              backgroundColor: idx % 2 === 0 ? "#fdfdfd" : "#fff",
              transition: "background 0.3s",
              cursor: "default",
            }}
            onMouseEnter={(e) => (e.currentTarget.style.backgroundColor = "#fff3eb")}
            onMouseLeave={(e) => (e.currentTarget.style.backgroundColor = idx % 2 === 0 ? "#fdfdfd" : "#fff")}
          >
            <td style={{ padding: "12px" }}>{uni.partner_university}</td>
            <td style={{ padding: "12px" }}>{uni.country}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default ResultsTable;
